          description: "36-bit string identifying an NR Cell Id as specified in clause\
            \ 9.3.1.7 of 3GPP TS 38.413,  in hexadecimal representation. Each character\
            \ in the string shall take a value of \"0\" to \"9\",  \"a\" to \"f\"\
            \ or \"A\" to \"F\" and shall represent 4 bits. The most significant character\
            \  representing the 4 most significant bits of the Cell Id shall appear\
            \ first in the string, and  the character representing the 4 least significant\
            \ bit of the Cell Id shall appear last in the  string. \n"
          pattern: "^[A-Fa-f0-9]{9}$"
          type: string
        nid:
          description: "This represents the Network Identifier, which together with\
            \ a PLMN ID is used to identify an SNPN (see 3GPP TS 23.003 and 3GPP TS\
            \ 23.501 clause 5.30.2.1). \n"
          pattern: "^[A-Fa-f0-9]{11}$"
          type: string
      required:
      - nrCellId
      - plmnId
      type: object
    NrCellId:
      description: "36-bit string identifying an NR Cell Id as specified in clause\
        \ 9.3.1.7 of 3GPP TS 38.413,  in hexadecimal representation. Each character\
        \ in the string shall take a value of \"0\" to \"9\",  \"a\" to \"f\" or \"\
        A\" to \"F\" and shall represent 4 bits. The most significant character  representing\
        \ the 4 most significant bits of the Cell Id shall appear first in the string,\
        \ and  the character representing the 4 least significant bit of the Cell\
        \ Id shall appear last in the  string. \n"
      pattern: "^[A-Fa-f0-9]{9}$"
      type: string
    Pei:
      description: "String representing a Permanent Equipment Identifier that may\
        \ contain - an IMEI or IMEISV, as  specified in clause 6.2 of 3GPP TS 23.003;\
        \ a MAC address for a 5G-RG or FN-RG via  wireline  access, with an indication\
        \ that this address cannot be trusted for regulatory purpose if this  address\
        \ cannot be used as an Equipment Identifier of the FN-RG, as specified in\
        \ clause 4.7.7  of 3GPP TS23.316. Examples are imei-012345678901234 or imeisv-0123456789012345.\
        \ \n"
      pattern: "^(imei-[0-9]{15}|imeisv-[0-9]{16}|mac((-[0-9a-fA-F]{2}){6})(-untrusted)?|eui((-[0-9a-fA-F]{2}){8})|.+)$"
      type: string
    LocationAreaId:
      description: "Contains a Location area identification as defined in 3GPP TS\
        \ 23.003, clause 4.1."
      example:
        plmnId:
          mnc: mnc
          mcc: mcc
        lac: lac
      properties:
        plmnId:
          $ref: '#/components/schemas/PlmnId'
        lac:
          description: Location Area Code.
          pattern: "^[A-Fa-f0-9]{4}$"
          type: string
      required:
      - lac
      - plmnId
      type: object
    RoutingAreaId:
      description: "Contains a Routing Area Identification as defined in 3GPP TS 23.003,\
        \ clause 4.2."
      example:
        rac: rac
        plmnId:
          mnc: mnc
          mcc: mcc
        lac: lac
      properties:
        plmnId:
          $ref: '#/components/schemas/PlmnId'
        lac:
          description: Location Area Code
          pattern: "^[A-Fa-f0-9]{4}$"
          type: string
        rac:
          description: Routing Area Code
          pattern: "^[A-Fa-f0-9]{2}$"
          type: string
      required:
      - lac
      - plmnId
      - rac
      type: object
    ImsEvent:
      anyOf:
      - enum:
        - ADC_ESTABLISHMENT
        - ADC_RELEASE
        - BDC_ESTABLISHMENT
        - BDC_RELEASE
        type: string
      - type: string
      description: The IMS events
    AccessTokenErr:
      description: Error returned in the access token response message
      properties:
        error:
          enum:
          - invalid_request
          - invalid_client
          - invalid_grant
          - unauthorized_client
          - unsupported_grant_type
          - invalid_scope
          type: string
        error_description:
          type: string
        error_uri:
          type: string
      required:
      - error
      type: object
    AccessTokenReq:
      description: Contains information related to the access token request
      properties:
        grant_type:
          enum:
          - client_credentials
          type: string
        nfInstanceId:
          description: "String uniquely identifying a NF instance. The format of the\
            \ NF Instance ID shall be a  Universally Unique Identifier (UUID) version\
            \ 4, as described in IETF RFC 4122. \n"
          format: uuid
          type: string
        nfType:
          $ref: '#/components/schemas/NfType'
        targetNfType:
          $ref: '#/components/schemas/NfType'
        scope:
          pattern: "^([a-zA-Z0-9_:-]+)( [a-zA-Z0-9_:-]+)*$"
          type: string
        targetNfInstanceId:
          description: "String uniquely identifying a NF instance. The format of the\
            \ NF Instance ID shall be a  Universally Unique Identifier (UUID) version\
            \ 4, as described in IETF RFC 4122. \n"
          format: uuid
          type: string
        requesterPlmn:
          $ref: '#/components/schemas/PlmnId'
        requesterPlmnList:
          items:
            $ref: '#/components/schemas/PlmnId'
          minItems: 2
          type: array
        requesterSnssaiList:
          items:
            $ref: '#/components/schemas/Snssai'
          minItems: 1
          type: array
        requesterFqdn:
          description: Fully Qualified Domain Name
          maxLength: 253
          minLength: 4
          pattern: "^([0-9A-Za-z]([-0-9A-Za-z]{0,61}[0-9A-Za-z])?\\.)+[A-Za-z]{2,63}\\\
            .?$"
          type: string
        requesterSnpnList:
          items:
            $ref: '#/components/schemas/PlmnIdNid'
          minItems: 1
          type: array
        targetPlmn:
          $ref: '#/components/schemas/PlmnId'
        targetSnpn:
          $ref: '#/components/schemas/PlmnIdNid'
        targetSnssaiList:
          items:
            $ref: '#/components/schemas/Snssai'
          minItems: 1
          type: array
        targetNsiList:
          items:
            type: string
          minItems: 1
          type: array
        targetNfSetId:
          description: "NF Set Identifier (see clause 28.12 of 3GPP TS 23.003), formatted\
            \ as the following string \"set<Set ID>.<nftype>set.5gc.mnc<MNC>.mcc<MCC>\"\
            , or  \"set<SetID>.<NfType>set.5gc.nid<NID>.mnc<MNC>.mcc<MCC>\" with \
            \ <MCC> encoded as defined in clause 5.4.2 (\"Mcc\" data type definition)\
            \  <MNC> encoding the Mobile Network Code part of the PLMN, comprising\
            \ 3 digits. \n  If there are only 2 significant digits in the MNC, one\
            \ \"0\" digit shall be inserted \n  at the left side to fill the 3 digits\
            \ coding of MNC.  Pattern: '^[0-9]{3}$'\n<NfType> encoded as a value defined\
            \ in Table 6.1.6.3.3-1 of 3GPP TS 29.510 but \n  with lower case characters\
            \ <Set ID> encoded as a string of characters consisting of \n  alphabetic\
            \ characters (A-Z and a-z), digits (0-9) and/or the hyphen (-) and that\
            \ \n  shall end with either an alphabetic character or a digit. \n"
          type: string
        targetNfServiceSetId:
          description: "NF Service Set Identifier (see clause 28.12 of 3GPP TS 23.003)\
            \ formatted as the following  string \"set<Set ID>.sn<Service Name>.nfi<NF\
            \ Instance ID>.5gc.mnc<MNC>.mcc<MCC>\", or  \"set<SetID>.sn<ServiceName>.nfi<NFInstanceID>.5gc.nid<NID>.mnc<MNC>.mcc<MCC>\"\
            \ with  <MCC> encoded as defined in clause 5.4.2 (\"Mcc\" data type definition)\
            \   <MNC> encoding the Mobile Network Code part of the PLMN, comprising\
            \ 3 digits. \n  If there are only 2 significant digits in the MNC, one\
            \ \"0\" digit shall be inserted \n  at the left side to fill the 3 digits\
            \ coding of MNC.  Pattern: '^[0-9]{3}$'\n<NID> encoded as defined in clause\_\
            5.4.2 (\"Nid\" data type definition)  <NFInstanceId> encoded as defined\
            \ in clause 5.3.2  <ServiceName> encoded as defined in 3GPP TS 29.510\
            \  <Set ID> encoded as a string of characters consisting of alphabetic\
            \ \n  characters (A-Z and a-z), digits (0-9) and/or the hyphen (-) and\
            \ that shall end \n  with either an alphabetic character or a digit.\n"
          type: string
        hnrfAccessTokenUri:
          description: String providing an URI formatted according to RFC 3986.
          type: string
        sourceNfInstanceId:
          description: "String uniquely identifying a NF instance. The format of the\
            \ NF Instance ID shall be a  Universally Unique Identifier (UUID) version\
            \ 4, as described in IETF RFC 4122. \n"
          format: uuid
          type: string
        vendorId:
          description: Vendor ID of the NF Service instance (Private Enterprise Number
            assigned by IANA)
          pattern: "^[0-9]{6}$"
          type: string
        analyticsIds:
          items:
            $ref: '#/components/schemas/NwdafEvent'
          minItems: 1
          type: array
        requesterInterIndList:
          items:
            $ref: '#/components/schemas/MlModelInterInd'
          minItems: 1
          type: array
        sourceVendorId:
          description: Vendor ID of the NF Service instance (Private Enterprise Number
            assigned by IANA)
          pattern: "^[0-9]{6}$"
          type: string
      required:
      - grant_type
      - nfInstanceId
      - scope
      type: object
    MlModelInterInd:
      description: ML Model Interoperability Indicator per Analytics Id
      properties:
        analyticsId:
          $ref: '#/components/schemas/NwdafEvent'
        vendorList:
          items:
            $ref: '#/components/schemas/VendorId'
          minItems: 1
          type: array
      required:
      - analyticsId
      - vendorList
      type: object
    NoProfileMatchInfo:
      description: Provides the reason for not finding NF matching the search criteria
      properties:
        reason:
          $ref: '#/components/schemas/NoProfileMatchReason'
        queryParamCombinationList:
          items:
            $ref: '#/components/schemas/QueryParamCombination'
          minItems: 1
          type: array
      required:
      - reason
      type: object
    NoProfileMatchReason:
      anyOf:
      - enum:
        - REQUESTER_PLMN_NOT_ALLOWED
        - TARGET_NF_SUSPENDED
        - TARGET_NF_UNDISCOVERABLE
        - QUERY_PARAMS_COMBINATION_NO_MATCH
        - TARGET_NF_TYPE_NOT_SUPPORTED
        - UNSPECIFIED
        type: string
      - type: string
      description: No Profile Match Reason
    QueryParamCombination:
      description: Contains a list of Query Parameters
      properties:
        queryParams:
          items:
            $ref: '#/components/schemas/QueryParameter'
          minItems: 1
          type: array
      required:
      - queryParams
      type: object
    QueryParameter:
      description: Contains the name and value of a query parameter
      properties:
        name:
          type: string
        value:
          type: string
      required:
      - name
      - value
      type: object
    DnnSmfInfoItem_dnn:
      anyOf:
